VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 16, 'face, palms and soles, as well as failure of 2 systemic therapies of at least 6 weeks duration each. TNF alpha inhibitors (etanercept, adalimumab, infliximab and their biosimilars) are rarely used today as first-line therapies due to the availability of more effective drugs with higher psoriasis clearance rates and longer persistence of effect. However, they are often utilised in inpatient treatment for severe pustular psoriasis due to their rapidity of action. TNF alpha inhibitors are contraindicated in patients with active infections including tuberculosis, and have a higher rate of infection than the other biologic agents. They may worsen congestive cardiac failure. Although effective in clearing skin disease (up to 45% in infliximab), most patients show loss of efficacy over 2 to 3 years.', '{0.32738468050956726,0.5252475142478943,0.05897562578320503,-0.03369356691837311,0.372802734375,0.49324822425842285,0.2900158762931824,0.5953172445297241,0.3221939504146576,-1.0267882347106934,-0.45354825258255005,-0.6940926909446716,0.4913925528526306,-0.542853593826294,-1.0271556377410889,0.03727409616112709,0.660550057888031,0.01360572874546051,0.5465105772018433,0.4312543570995331,-0.7212520837783813,0.6205509901046753,-0.20233555138111115,-0.11217156052589417,0.1636650711297989,0.39393699169158936,-0.5889402627944946,-0.319244921207428,0.6398544907569885,-0.30879560112953186,-0.34712502360343933,0.439221054315567,-0.2430572509765625,0.24532154202461243,-0.6665350794792175,-0.09596934914588928,-0.6789504289627075,0.6904395818710327,-0.7680003643035889,-0.275574266910553,0.6362177133560181,0.24763010442256927,-0.5375686883926392,-0.8786070346832275,0.20937491953372955,0.05949538201093674,0.36546459794044495,0.12093717604875565,-0.07950323075056076,-0.7916398644447327,0.32985052466392517,-0.07745355367660522,0.10831468552350998,0.23580829799175262,0.07566200196743011,-0.3445998430252075,0.655191302299