VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 17, 'aring skin disease (up to 45% in infliximab), most patients show loss of efficacy over 2 to 3 years. Anti-IL-17 therapies (bimekizumab, ixekizumab, secukinumab), anti-IL-23 therapies (guselkumab, risankizumab, tildrakizumab) and anti-IL-12 and 23 therapies (ustekinumab) show strong efficacy (up to 88% patients with near-complete skin clearance) and long persistence. Anti-IL-17 therapies have slightly higher rates of infection, particularly oral thrush, but have demonstrated better efficacy on joints, compared with anti-IL-23 therapies. Anti-IL-17 therapies are contraindicated in inflammatory bowel disease as they may catastrophically flare active disease. Anti-IL-23 and anti-IL-12 and 23 therapies have few side effects (injection-site reaction is most common). They have some efficacy especially in peripheral psoriatic arthritis, and in higher doses are effective in inflammatory bowel disease. Psoriasis is a common multisystem inflammatory disease that has profound impact on patients.', '{0.813647449016571,0.18901848793029785,0.4404587149620056,-0.2620373070240021,0.03839028999209404,0.31926676630973816,-0.34976986050605774,0.4977784752845764,0.2622598707675934,-0.9713982343673706,-0.6010096669197083,-0.2079792469739914,0.5240545868873596,-0.7204344272613525,-0.16309373080730438,0.7748365998268127,0.5871713757514954,0.171341210603714,0.46460551023483276,0.1293472945690155,-0.9828254580497742,0.6002891063690186,0.06912706047296524,-0.31238552927970886,0.19707448780536652,-0.038463473320007324,-0.5119082927703857,-0.028894511982798576,0.4063776135444641,-0.3110632002353668,0.35832521319389343,0.6909936666488647,-0.492935448884964,0.523804783821106,-0.3308667540550232,-0.32158827781677246,-0.323170006275177,0.4751408100128174,-1.4460505247116089,0.0790962502360344,0.3857227563858032,0.1982865184545517,-0.179890975356102,-0.2017834633588791,0.15849469602108002,0.5322150588035583,0.32624343037605286,