VALUES ('The Epidemiology and Determinants of Opportunistic Intestinal Parasites Among HIV-Positive Patients Attending Care and Treatment Centers in Northcentral Ethiopia', 'Opportunistic intestinal parasites (OIPs), such as coccidian parasites (like  Past research on OIP infections has shown that a range of factors play a role in spreading the infection in regions with tropical and subtropical climates. These include determinants like not keeping sanitary facilities clean, using unsafe water sources, not having enough toilets, not teaching people about how the infection spreads, not following good hygiene habits, not having enough income, and living in overcrowded conditions [ Different researchers reported the prevalence of coccidian parasites in Ethiopia among people with HIV [ In several rural villages within the Debre Tabor district, clean water is scarce, forcing community members to rely on unsafe water sources. This reliance on diverse water sources significantly increases the likelihood of illness from waterborne diseases. Additionally, the levels of environmental sanitation and personal hygiene in these rural villages are notably poor (South Gondar Health Office, personal communication, November 2019). Additionally, there is no information about the coinfection rate of OIPs among patients attending ART. Up-to-date information regarding OIP magnitude and predictors is vital for better treatment and interventions and may support national and international HIV END strategies and eradication programs. Therefore, the study is aimed at estimating the prevalence of OIPs and determining drivers among HIV-positive patients on ART treatment in Debre Tabor General Hospital, Northcentral Ethiopia. A hospital-based cross-sectional study was conducted between December 2019 and February 2020 at Debre Tabor General Hospital in Debre Tabor town, located in Northcentral Ethiopia. Debre Tabor is a town situated 667km away from Addis Ababa, elevated at 2706m above sea level. Serving around 2.3 million individuals, the hospital boasts over 110 beds. The hospital has been providing HIV counseling, testing, treatment, and follow-up services since the 1990s. At the hospital''s ART clinic, 2210 HIV/AIDS patients were actively receiving ART during the study period. The medical records, however, pointed to a greater figure. At Debre Tabor General Hospital, all HIV-positive individuals who registered at the ART clinic were included as a source of the population. All registered HIV/AIDS patients actively attending appointments or follow-up at the ART clinic of the hospital during the study duration were chosen for the research. This study encompassed all individuals with HIV/AIDS who provided written consent to participate and visited ART clinics during the examination period. Only those who expressed a desire to take part in the study were included. Those participants who have been taking antiparasitic medication during the last 3 months were excluded from this study. Also, those severely ill patients who were unable to respond to questions or with a history or diagnosis of acute or chronic diseasecausing immune suppression (COVID-19, tuberculosis, asthma, cirrhosis, cancer, diabetes, cystic fibrosis, transplant recipients, and chronic obstructive pulmonary disease) were excluded from the study. We used a formula to determine the size of the sample ( After adding 10% (38) for contingency, the final sample size was 422 individuals. A systematic random sampling method was employed by calculating the  The study was focused on the following independent variables: sociodemographic status, environmental and personal hygiene, the status of ART adherence, clinical conditions, and the immune status of the patient. The prevalence of OIPs was considered the response variable in the present study. A structured questionnaire was prepared, pretested, and validated before 2 weeks of study at Felege Hiwot Referral Hospital in Bahir Dar on 20 people with HIV to evaluate the quality and strength of the questionnaire. The ART clinician and principal investigators provided a directional view and awareness of the study''s objective to encourage active participation in filling out the questionnaire. The questionnaire was originally prepared in English and then translated to Amharic and back to English to obtain content validity. After modifying and assuring its quality, the pretested questionnaires were administered to respondents to generate data on risk factors of OIPs, such as questions related to sociodemographic characteristics, behavioral habits, hygienic and sanitary conditions, environmental conditions, and clinical information. The recent CD4+ T cell count data was taken from patients'' medical records. Fluorescence-activated cell sorting (FACS) analysis, a specialized form of flow cytometry (Becton Dickinson Immunocytometry Systems, San Jose, California, United States), was used to determine the count at the Debre Tabor General Hospital ART clinic. The proper method for the collection of stool samples was provided to ensure the favorable condition of the stool sample. Also, an oral description and specific instructions on proper handling and avoiding contamination of the stool specimen were given to the entire participant by the investigator. Disposable plastic cups with an applicator spoon for the collection of stool samples were provided for study subjects by labeling them with their unique codes, and after that, they were told to bring about 510g of fresh stool specimen each. Initially, a wet mount was prepared, followed by the preservation of the remaining sample in a 10% formalin solution. The collected stool samples were promptly preserved in 10% formalin until microscopy, which helps maintain the shape and size of protozoan and helminth parasites and prevents further development [ A direct wet-mount smear was examined immediately by using normal saline. Observe under a light microscope at 100x and 400x magnifications to detect the presence of motile parasite stages. After preserving the remaining sample in 10% formalin, it was carefully examined using the formolether concentration technique along with a modified ZiehlNeelsen staining method [ Briefly, 1g of stool was taken from the preserved stool, mixed with a 10% formalin solution, and sieved through double-layered gauze. The filtrate was transferred to a 15-mL conical centrifuge tube and added to 7mL of formalin saline using a plastic pipette and 3mL of diethyl ether. Then, the content was shaken vigorously and centrifuged for 5min at 3000rpm. After collecting the sediment, a slide was prepared and examined under a light microscope at both 100x and 400x magnification to identify eggs, cysts, and larvae of various parasites. A small portion of the fresh stool sample was processed for the detection of  Before actual data collection began, experienced laboratory technologists pretested the questionnaire and other materials, such as the microscope, centrifuge, and chemicals used during data collection. The specimens were also checked for serial number, quality, and collection procedures. The stool samples were examined by two laboratory technicians in order to avoid observer bias. If conflicting results were found, a different technician examined the stool sample slide, and their findings were deemed conclusive. In addition to the color atlas, the laboratory technicians used known positive coccidian parasite samples as positive controls and performed staining. Furthermore, the researchers validated their staining procedure against the literature using known positive samples to ensure it was functioning as expected. Regarding CD4+ T cells, data collectors were trained, and after the data collection process, the collected data were double-checked for completeness by three investigators, and any incomplete or misfiled data were filed again. Next, the findings from the lab were detailed meticulously on a neatly organized document before being affixed to the survey. Descriptive statistics were used to understand the property and the pattern of data collected from respondents. The data obtained from questionnaires was entered through the EPI-INFO 7 computer program for precoding data and then exported to SPSS Version 23. A chi-square test was applied to determine the association between parasitic infection and CD4+ T cell count. The logistic regression model was employed to assess potential risk factors. The strength of associations was measured using odds ratios (OR) and 95% confidence intervals (CI). Multivariate regression analysis was then applied for variables with  In general, our research adhered to the guidelines set out in the Declaration of Helsinki [ A total of 384 HIV-positive individuals were included. Of these, 222 (57.8%) were females, and 215 (56.0) of the respondents were aged 3049, with the mean (SD) age of 34.30 (11.073) years. The majority of the participants were urban residents, 262 (68.2%);

