VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'on diverse water sources significantly increases the likelihood of illness from waterborne diseases. Additionally, the levels of environmental sanitation and personal hygiene in these rural villages are notably poor (South Gondar Health Office, personal communication, November 2019). Additionally, there is no information about the coinfection rate of OIPs among patients attending ART. Up-to-date information regarding OIP magnitude and predictors is vital for better treatment and interventions and may support national and international HIV END strategies and eradication programs. Therefore, the study is aimed at estimating the prevalence of OIPs and determining drivers among HIV-positive patients on ART treatment in Debre Tabor General Hospital, Northcentral Ethiopia. A hospital-based cross-sectional study was conducted between December 2019 and February 2020 at Debre Tabor General Hospital in Debre Tabor town, located in Northcentral Ethiopia.', '{0.6446280479431152,-0.7832332849502563,0.5099038481712341,-0.5760122537612915,0.07703079283237457,0.22736814618110657,0.4523179531097412,0.05899523198604584,-0.22546163201332092,0.00425124354660511,0.008296910673379898,0.46288058161735535,0.3730180561542511,0.8095036745071411,-0.120104119181633,-0.0674833282828331,-0.30015161633491516,0.10318658500909805,-0.05581819638609886,-0.21689973771572113,-0.7987083196640015,-0.06573126465082169,-0.4795227348804474,0.07656533271074295,-0.1299465149641037,-0.06829115748405457,0.3975543677806854,-0.9761617183685303,0.2041231393814087,0.4965537190437317,0.020032500848174095,0.21438853442668915,0.014813678339123726,0.31253185868263245,-0.46414613723754883,-0.36784976720809937,0.13231894373893738,-0.3365287184715271,-0.5905203819274902,-0.03182948753237724,-0.531308650970459,0.24685576558113098,0.7302320003509521,-0.07647256553173065,-0.0492633581161499,-0.35224011540412903,0.33914175629615784,0.5445201992988586,0.43