VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'February 2020 at Debre Tabor General Hospital in Debre Tabor town, located in Northcentral Ethiopia. Debre Tabor is a town situated 667km away from Addis Ababa, elevated at 2706m above sea level. Serving around 2.3 million individuals, the hospital boasts over 110 beds. The hospital has been providing HIV counseling, testing, treatment, and follow-up services since the 1990s. At the hospital''s ART clinic, 2210 HIV/AIDS patients were actively receiving ART during the study period. The medical records, however, pointed to a greater figure. At Debre Tabor General Hospital, all HIV-positive individuals who registered at the ART clinic were included as a source of the population. All registered HIV/AIDS patients actively attending appointments or follow-up at the ART clinic of the hospital during the study duration were chosen for the research.', '{0.6056188941001892,-0.48493924736976624,0.12776492536067963,-0.4231056869029999,-0.01470254547894001,0.12015382200479507,0.6448660492897034,0.09198880195617676,-0.3832477629184723,0.17243364453315735,-0.09380049258470535,0.5656083822250366,0.43198511004447937,0.5139870047569275,-0.39579302072525024,0.08775269985198975,0.26005083322525024,0.31979531049728394,0.4464351236820221,-0.14147022366523743,-0.31333327293395996,-0.24878554046154022,-0.016659658402204514,0.15730588138103485,0.07959180325269699,-0.03191829100251198,-0.3026959300041199,-0.8738624453544617,-0.24525736272335052,0.10967128723859787,-0.06582196056842804,0.0559115931391716,-0.30644986033439636,0.31112411618232727,-0.6956828832626343,-0.021936599165201187,0.057564932852983475,-0.7911853194236755,-0.6035855412483215,0.3160938620567322,-0.34162652492523193,0.5878260135650635,0.5341102480888367,0.09830145537853241,-0.3440045416355133,-0.5977166891098022,0.09117655456066132,0.5972105860710144,0.6237463355064392,0.1067155972123146,-0.04914909973740578,0.942423403263092,0.1256243735551834,0.315689