VALUES ('Cancer Screening Progress and Non-invasive Screening Opportunities Since Onset of the COVID-19 Pandemic', 'Cancer screening lowers morbidity and mortality from cancer, and is cost-effective. The COVID-19 pandemic upended cancer screening utilization in 2020 with data showing a deficit in screened patients in 2020 and 2021 as compared to 2019, with return to 2019 baseline screening levels by December 2022. The cumulative shortfall in screenings, lasting nearly three years into the pandemic, are predicted by models to generate an incremental population cancer burden in the out years of the models. Recovery of screening rates may vary based on the racial or ethnic population, and time will tell if there is an uneven burden of future cancers that worsen cancer incidence and mortality in those populations, some even after years of gains of reducing disparities for cancer screening. For some cancer screenings, particularly cervical and colorectal cancer, use of at-home non-invasive tests may increase screening participation overall across multiple populations, and may help mitigate some of the screening shortfalls from 2020 to 2022 by elevating numbers of the population screened. For colorectal cancer, new additional comparably sensitive or ease-of-use non-invasive screening tests are being added for utilization.', 'PubMed_Central', 'cancer_screening', 'https://www.ncbi.nlm.nih.gov/pmc/', 'research_article', '{"content_hash": "17f4d450cff8f0e7", "embedding_date": "2025-06-25T14:49:30.041702", "scraper_source": "PubMed_Central", "category": "research_literature", "subcategory": "pubmed_central", "document_type": "research_article", "published_date": "", "original_url": "https://www.ncbi.nlm.nih.gov/pmc/"}', 1221);

