VALUES ('Genetic ancestry superpopulations show distinct prevalence and outcomes across pediatric central nervous system tumors from the Pediatric Brain Tumor Atlas and Pediatric Neuro-Oncology Consortium', 'Central nervous system (CNS) tumors lead to cancer-related mortality in children. Genetic ancestry-associated cancer prevalence and outcomes have been studied but are limited. We performed genetic ancestry prediction in 1,452 pediatric patients with paired normal and tumor whole genome sequencing from the Open Pediatric Cancer (OpenPedCan) project to evaluate the influence of reported race and ethnicity and ancestry-based genetic superpopulations on tumor histology, molecular subtype, survival, and treatment. Predicted superpopulations included African (AFR,  Genetic ancestry-associated differences exist across pediatric CNS tumor histological and molecular subtypes from PBTA and PNOC. Further investigation into genetic and socioeconomic factors contributing to these observed inequities is needed. Distinct associations of genetic ancestry-based superpopulations exist within pediatric CNS tumor histologic and molecular subtypes and correlate with survival outcomes and treatment. This work provides critical insight into the impact of reported race and ethnicity and genetic-based ancestry superpopulations on nearly 1500 pediatric patients with CNS tumors who had matched normal and tumor sequencing performed. We identify novel associations between ancestry superpopulations and tumor histology, molecular subtypes, and treatments received. Here, we begin to inform on the contributions of social constructs of race and ethnicity and tumor characteristics that are enriched among genetic-based ancestry superpopulations on clinical outcomes of pediatric patients with CNS tumors. Our findings indicate that potential social and genetic risk stratifications exist for pediatric CNS tumors and warrant further investigation to ensure equitable clinical outcomes for all patients. Primary central nervous system (CNS) tumors are the leading cause of cancer-related mortality in children. It is essential to recognize that race and ethnicity are social and cultural constructs distinct from genetic ancestry, which can be estimated using genetic markers that capture ancestral population migration patterns and admixture events. In the current study, we aim to go beyond previous work investigating genomic correlates of cancer risk in isolated silos and utilize a large cohort of patients with broad histologies of primary pediatric CNS tumors to explore the potential contributions of genomics and social health risk categories. We specifically utilize predicted genetic ancestries to evaluate associations with incidence and clinical outcomes across a diverse group of pediatric CNS tumor diagnoses. This work provides an essential framework to better characterize the contributions of genetic and sociodemographic factors to cancer outcomes in patients with pediatric CNS tumors, and ideally augment our understanding of pediatric CNS tumor risk stratification through a lens of health equity. The pediatric CNS tumor patient cohort used in this study was derived from the Open Pediatric Cancer (OpenPedCan) project, We used the somalier suite of tools (v.0.2.15) to predict ancestry superpopulations from non-tumor WGS data. All high-confidence, in-frame  The association between reported race and ethnicity and genetic ancestry superpopulation, as well as superpopulation enrichment within race and ethnicity groups, was assessed using Fishers exact tests. We integrated CNS tumor histology and molecular subtype data from matched tumor samples with survival data to determine whether genetic ancestry superpopulations were associated with cancer type, subtype, and/or survival. Nonrandom distribution and enrichment of superpopulations within histologies and molecular subtypes were assessed using Fishers exact tests and one-way Fishers exact tests, respectively. Statistical significance was defined as Benjamini-Hochberg-adjusted FDR<0.05, and marginally significant trends were defined as  We performed KaplanMeier analysis of OS and EFS within histologies and molecular subtypes to compare outcomes of patients of different genetic ancestry groups. We generated Cox proportional-hazards regression models to identify additional variables that were predictive of survival using the following covariates: predicted genetic ancestry superpopulation, age at diagnosis (all models), molecular subtype (ATRT, LGG, HGG, ependymoma [EPN], medulloblastoma [MB], mixed glioneuronal tumors), and extent of tumor resection (ATRT, LGG, EPN, HGG, MB, and schwannoma, to accommodate the known impact of degree of resection on outcome in these cohorts). We generated separate models replacing ancestry superpopulation with (1) EUR membership (EUR or non-EUR) and (2) somalier PC values to assess whether other measures of genetic ancestry were associated with distinct survival outcomes. Chi-square analyses were run on each multivariate model to assess the overall effect of superpopulation on survival in each independent tumor histology or molecular subtype cohort. To assess the association between  We predicted genetic ancestry for 1452 pediatric CNS tumor patients from the PBTA and PNOC. Patients were classified into genetic ancestry superpopulations as follows:  Genetic ancestry prediction in a pediatric central nervous system tumor cohort.  There was a significant nonrandom association between reported race and ethnicity and superpopulation ( We identified a significant nonrandom association between genetic ancestry superpopulation and CNS tumor histology ( Distribution of CNS tumor histologies and molecular subtypes across genetic ancestry superpopulations. ( We observed significant enrichment of genetic ancestry superpopulations in molecular subtypes of specific CNS tumor histologies. We found that patients with non- A recent report from the PNOC001 trial identified two classes of in-frame  
 We also observed breakpoint type-specific distribution of LGG tumors in CNS regions that correlated with the extent of tumor resection ( We identified eleven patients with seven distinct rare  We calculated median EFS and OS for each CNS tumor histology and molecular subtype with sufficient sample size ( Next, we assessed pairwise differences in patient survival by superpopulation within the cohorts selected above. Among patients with GCTs, those from non-EUR superpopulations exhibited significantly worse EFS relative to those from the EUR superpopulation (median EFS 0.5 vs. 2.1 years, HR=12.1, 95% CI=1.979.6,  Genetic ancestry-associated overall and event-free survival (EFS) differences in pediatric CNS tumor patients. KaplanMeier EFS curve in patients with germ cell ( Among patients with LGG, individuals from the AFR superpopulation exhibited significantly worse OS relative to those from the EUR superpopulation (median OS 2.9 vs. 4.2 years, HR=16.4, 95% CI=2.2122.0,  We next leveraged PC values derived from somalier-ancestry prediction to assess whether these continuous measures of estimated ancestry were associated with patient survival. Among the five derived PC values, we observed significant correlations with estimated probabilities of distinct superpopulations ( To explore therapeutic approaches employed across genetic ancestry superpopulations, we investigated degree of surgical intervention, clinical trial enrollment, and therapeutic regimens cohort-wide and within tumor histologies. We assessed degree of surgical resection by superpopulation for all major histologies with  Overall frequency of upfront clinical trial enrollment was significantly associated with genetic ancestry ( Overall frequency of clinical trial enrollment and photon vs. proton radiation at time of upfront diagnosis. Count of histologic diagnosis within each genetic ancestry superpopulation according to upfront clinical trial enrollment (left table), upfront proton radiation (middle table), and upfront photon radiation (right table) with associated percentages (parentheses) and p-values. Bold, italicized text denote statistical significance. DIPG = diffuse intrinsic pontine glioma, DMG = diffuse midline glioma, CNS = central nervous system. Abbreviations: AFR, African;

