VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'tric CNS tumor histologic and molecular subtypes and correlate with survival outcomes and treatment. This work provides critical insight into the impact of reported race and ethnicity and genetic-based ancestry superpopulations on nearly 1500 pediatric patients with CNS tumors who had matched normal and tumor sequencing performed. We identify novel associations between ancestry superpopulations and tumor histology, molecular subtypes, and treatments received. Here, we begin to inform on the contributions of social constructs of race and ethnicity and tumor characteristics that are enriched among genetic-based ancestry superpopulations on clinical outcomes of pediatric patients with CNS tumors. Our findings indicate that potential social and genetic risk stratifications exist for pediatric CNS tumors and warrant further investigation to ensure equitable clinical outcomes for all patients.', '{0.22764110565185547,0.1861458718776703,0.036657966673374176,-0.31634393334388733,-0.039787549525499344,-0.8095945119857788,0.07233630120754242,-0.5782190561294556,-0.48464956879615784,-0.15764616429805756,-0.5736051201820374,0.5952346324920654,0.09939729422330856,-0.20196586847305298,-0.2851352095603943,0.38335293531417847,1.8064548969268799,0.4619527757167816,-0.16787871718406677,0.3870507776737213,0.1639232337474823,0.331371009349823,-0.4903712272644043,0.29789504408836365,-0.32235202193260193,-0.49607858061790466,-0.37150487303733826,-0.4070148169994354,-0.25490304827690125,-0.48782286047935486,-0.006301011424511671,0.25418099761009216,1.1495105028152466,-0.10870126634836197,-0.16529755294322968,0.60638427734375,0.34401464462280273,0.363442987203598,-0.10132419317960739,-0.8517891764640808,0.6541814804077148,0.2435491979122162,0.441608726978302,-0.12444522231817245,0.12074477970600128,-0.6274429559707642,-0.5973185300827026,0.14114290475845337,-0.33934780955314636,-0.040205568075180054,-0.9015113115310669