VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'CNS tumors and warrant further investigation to ensure equitable clinical outcomes for all patients. Primary central nervous system (CNS) tumors are the leading cause of cancer-related mortality in children. It is essential to recognize that race and ethnicity are social and cultural constructs distinct from genetic ancestry, which can be estimated using genetic markers that capture ancestral population migration patterns and admixture events. In the current study, we aim to go beyond previous work investigating genomic correlates of cancer risk in isolated silos and utilize a large cohort of patients with broad histologies of primary pediatric CNS tumors to explore the potential contributions of genomics and social health risk categories. We specifically utilize predicted genetic ancestries to evaluate associations with incidence and clinical outcomes across a diverse group of pediatric CNS tumor diagnoses.', '{0.20403850078582764,0.028895054012537003,0.4832305908203125,-0.2544654309749603,0.08137194812297821,-0.5552770495414734,-0.13428673148155212,-0.75832200050354,-0.3458133041858673,0.13499121367931366,-0.4635066092014313,0.6202728152275085,0.32194823026657104,-0.5008697509765625,-0.27873775362968445,0.3699641823768616,1.1065117120742798,0.06522313505411148,0.16581860184669495,-0.24449430406093597,-0.11718910187482834,0.1128007099032402,-0.45977896451950073,0.39348575472831726,-0.4179145395755768,-0.5415375828742981,0.10106933861970901,-0.19342991709709167,-0.3539617955684662,0.3010326027870178,-0.01712735742330551,0.15312732756137848,1.1251455545425415,-0.28788700699806213,-0.07124170660972595,0.6235293745994568,0.04722803086042404,0.47387197613716125,-0.4766775965690613,-0.6232479810714722,0.2898790240287781,-0.01494345348328352,0.008050902746617794,-0.1213829442858696,-0.2916000485420227,-0.7329509258270264,-0.2621718943119049,0.02795753814280033,-0.23799701035022736,-0.02382772788405418