VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 10, 'frequency of clinical trial enrollment and photon vs. proton radiation at time of upfront diagnosis. Count of histologic diagnosis within each genetic ancestry superpopulation according to upfront clinical trial enrollment (left table), upfront proton radiation (middle table), and upfront photon radiation (right table) with associated percentages (parentheses) and p-values. Bold, italicized text denote statistical significance. DIPG = diffuse intrinsic pontine glioma, DMG = diffuse midline glioma, CNS = central nervous system. Abbreviations: AFR, African;

INSERT INTO document_embeddings (document_id, chunk_index, chunk_content, embedding)
VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 11, 'sessed whether frequency of proton versus photon radiation therapy differed across superpopulations. There was a trend toward genetic ancestry-dependent frequency of upfront proton radiation treatment across all tumor histologies ( We incorporated clinical trial and radiation therapy data into survival models to determine if treatment was associated with survival outcomes in tumor histologies for which genetic ancestry was a significant predictor of survival. There was no significant effect of treatment on survival for patients with LGG, EPN, or GCTs, indicating that statistically significant ancestry-related differences in survival were not statistically associated with clinical trial enrollment in our cohort ( In this study, we sought to investigate the influence of genetic ancestry on the prevalence of CNS tumor subtypes, treatment access, and survival outcomes in pediatric patients.', '{0.543497622013092,0.2528994381427765,-0.08098804205656052,0.1375410407781601,-0.3246685564517975,-1.3539435863494873,0.2800862491130829,-0.31877920031547546,-0.48104211688041687,0.36234673857688904,-0.2083611637353897,0.7571906447410583,-0.01756005361676216,-0.8491230010986328,-0.0740697979927063,-0.17176248133182526,2.3267035484313965,0.5896045565605164,-0.008172438479959965,0.7502859234809875,0.13994550704956055,0.31597211956977844,-0.15773499011993408,0.2943147122859955,-0.2861122190952301,-0.23755832016468048,-0.23568905889987946,0.21540391445159912,0.16247312724590302,-0.1530817598104477,-0.5280429124832153,0.305134117603302,0.9234458804130554,-0.16317535936832428,-0.4662930369377136,0.38246431946754456,0.1610351800918579,0.4177831709384918,-0.7826844453811646,-0.4503275156021118,0.3984948694705963,0.3398941457271576,0.08104116469621658,-0.1683983951807022,0.21771086752414703,-0.8126059174537659,-1.266287922859192,0.163661926984787,-0.34565889835357666,-0.06524184346199036,-0.36947622895240784,-0.544543