VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 12, 'the prevalence of CNS tumor subtypes, treatment access, and survival outcomes in pediatric patients. Our findings revealed significant associations between genetic ancestry superpopulations, prevalence of CNS tumor histologies and molecular subtypes, patient OS and EFS, and upfront treatment approaches. Notably, we also identified superpopulation-specific enrichment of  Race and ethnicity are social constructs based on membership in a group sharing cultural and behavioral traits, whereas genetic ancestry is based on variations in genomic structure between groups from similar geographic regions. We found significant associations between ancestry superpopulations and cancer groups. Patients with ATRT or meningioma tumors were significantly enriched among AFR patients. While previous work has shown an increased incidence of meningiomas among patients of reported Black race, We next report associations between predicted ancestry superpopulation and tumor molecular subtypes.', '{0.23989830911159515,0.02010963298380375,0.17744691669940948,-0.2258027195930481,0.05008538067340851,-1.1840245723724365,0.11189823597669601,-0.809447705745697,-0.8137092590332031,-0.15226881206035614,-0.49547427892684937,0.8005937933921814,0.3770754039287567,-0.005849103908985853,-0.44285547733306885,0.2584535479545593,1.6417917013168335,0.37440675497055054,-0.256192684173584,0.30931466817855835,-0.042494677007198334,0.20799678564071655,-0.11331983655691147,0.23167140781879425,-0.6167628765106201,-0.6766303181648254,-0.35691267251968384,-0.29408204555511475,-0.00400968873873353,-0.4292764961719513,-0.30961403250694275,0.2704735994338989,0.8453956246376038,0.009612438268959522,-0.29974132776260376,0.33558034896850586,0.5037534832954407,0.7469629645347595,-0.41526684165000916,-0.7421376705169678,0.5959833860397339,0.12518201768398285,0.5023679137229919,-0.4019014835357666,-0.05361313372850418,-0.4512158930301666,-1.02705276012