VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 14, 'lso found varying upfront clinical trial enrollment frequencies by genetic ancestry superpopulation. This is encouraging, as it highlights the importance of including patients from diverse genetic backgrounds in clinical research and may represent contemporary changes that better facilitate equitable enrollment in trials and research activities. Although our work included patients from a diverse set of genetic and predicted ancestral backgrounds, our data came from patients within the United States. Thus, our cohort was significantly enriched for the European superpopulation, with limited numbers of historically marginalized racial and ethnic groups in our study (ie, AI/AN and NHPI). Expanding access to international pediatric datasets with potentially unique SDoH considerations will be critical for including diverse representation in future research.', '{0.3117988109588623,-0.16664084792137146,-0.11607234925031662,0.28983941674232483,0.09954833984375,-0.5876259803771973,0.15675440430641174,-0.061226800084114075,-0.09410164505243301,-0.6797400116920471,-0.6654558777809143,0.4072892665863037,0.04318629577755928,-0.35288676619529724,-0.5347541570663452,-0.14403167366981506,0.8760128617286682,0.2947119474411011,0.10184695571660995,0.37517014145851135,0.016350258141756058,0.2590107321739197,-0.1372223198413849,0.6981906294822693,0.1755417436361313,-0.2502497732639313,0.12793220579624176,0.06674753129482269,0.0358910970389843,-0.2814796268939972,0.2477317750453949,0.059845853596925735,0.7735371589660645,0.0728764683008194,0.5312013030052185,0.9149847626686096,-0.0797671377658844,0.741008996963501,-0.6246932744979858,-0.5823101997375488,0.16789335012435913,0.8560603857040405,0.4977075457572937,-0.8175500631332397,-0.2322670966386795,-0.2658024728298187,-0.8064608573913574,0.2469208538532257,-0.12041734158992767,0.4073058068752289,-0.5707823038101196,-0.3508252501487732,0.11925991624593735,-0.05225960