VALUES ('Research on mammary gland hyperplasia compound patents herbal combination rules based on complex system entropy clustering: A review', 'The aim of this study was to investigate the combination rules of herbal compound patents for the treatment of mammary gland hyperplasia (MGH). Herbal compound patents (oral drugs) for the treatment of MGH from the past 31 years were collected, and a database was created. Complex system entropy clustering was used to analyze the prescription rule of herbal compound patents for the treatment of MGH. In total, 765 MGH herbal compound authorized patents, including 136 Chinese herbs, were identified. High-frequency herbs, herbal pairs, and core associations were obtained by complex system entropy clustering. MGH herbal compound patents are known to activate blood circulation, remove stasis, soothe the liver, regulate  Mammary gland hyperplasia (MGH) is a common gynecological disease among young and middle-aged women whose incidence is increasing year by year, which seriously affects the patients quality of life. Androgens, progesterone (P), tamoxifen, bromocriptine, danazol and other hormonal drugs are commonly used to treat this disease. However, although these drugs can improve the symptoms of MGH, their side effects are severe. Notably, the traditional Chinese medicine (TCM) compound prescription for treating MGH shows its effectiveness in the treatment of this disease. In long-term clinical practice, TCM has accumulated numerous herbal compounds with outstanding curative effects. The herbal combination pattern determined by complex system-based entropy clustering could enhance the accuracy of clinical prescriptions, making the selection of herbal core combinations easier and more accurate. There are many academic cores in the MGH herbal compound patents, which will have remarkable curative effect on clinical treatment. In this study, the patents for oral herb prescriptions for MGH treatment from the past 30 years were selected for analysis. Herbal frequency, association, and composition compatibility regularity were investigated to guide the clinical prescription and development of new drugs. This study introduces the boundary mutual distance into the mutual information registration measure. By combining mutual information and mutual distance information, the resulting new registration measure improves the mutual information registration measuring function, thus reducing the risk of the conventional maximum mutual information function falling into the extremum and defining the accurate ratio of information about the MGH patent compound composition (Figs.  Algorithm of the research process. Research process of entropy clustering of complex systems for traditional Chinese medicine compound patents. Key steps in entropy clustering research of complex systems. This study aims to investigate the active ingredients, targets, pathways, and mechanisms of drug pairs or drug combinations in the treatment of MGH. The literature search covered the Derwent World Patent Index database, the National Intellectual Property Office patent database, the World Digital Library of Intellectual Property, the Multinational Patent Review Information Search System, TCM enterprises, and related herbal intellectual property organizations. MGH herbal compound authorized patents between January 1993 and December 2023 were retrieved. (Breast hyperplasia or hyperplasia of mammary glands or cyclomastopathy or lobular hyperplasia of the breast or Benign breast hyperplasia)+(TCM or herbal medicine or natural medicine or herbs)+classification numbers (A61K 36/00 or A61P). Based on the recall-precision curve, the retrieval formulas were optimized and adjusted dynamically. 1. Single herb 2. Integrated use of multiple approaches 3. Simultaneously treating other diseases 4. Combined medication All the collected literature on patents for herbal compounds for breast hyperplasia were checked by 3 persons to ensure accuracy and precision. The EpiData 3.1 system (EpiData Association, Odense, Denmark) was used to develop the data mining software. Each eligible MGH prescription patent herb was assigned a 2-valued variable. Data mining was performed using mathematical entropy modeling and screening out herbal pairs and core combinations with strong efficacy coherence. Complex system entropy clustering and improved mutual information methods were used to construct the research program and create the research model in order to initiate the quantitative description of the correlation coefficient of Chinese medicine. The ultimate purpose was to extract the herbal pairs and herbal core combinations. Mathematical modeling was used to mine the MGH prescription patents. The most relevant core combinations of Chinese herbs were screened out by mathematical calculations, comprising core herbal pairs and herbal teams. The improved mutual information methods, complex system entropy clustering methods, and unsupervised entropy hierarchical clustering methods were used for data analysis. The core formulas of the improved mutual information methods and complex system entropy clustering methods are the following: Unsupervised hierarchical clustering can be described using the following formula:  where  The above process can also be expressed as follows: where  In this study, a total of 765 prescriptions in the database were analyzed and screened using the methods mentioned above. A total of 136 Chinese herbs with high frequency and 62 regularly used drug pairs were obtained using an improved mutual information method, and 32 groups of core combinations were obtained using complex system-based entropy clustering. The high frequency efficacy, high frequency herbs, herbal pairs, efficacy pairing of Chinese herbs and herbal core combinations are shown in Tables  The effects of high frequency herbs are associated with promoting blood circulation, removing blood stasis, detumescing, pain relieving, clearing heat and detoxifying, liver soothing and regulating  High frequency efficacy. High frequency herbs. Herbal pair and its correlation coefficient. Efficacy combinations of Chinese herbs. Herbal core combinations. Frequency ratios of various functions herbs. Herbal core combinations complex network. Drug pairs association. Frequency ratios of high frequency herbs. Herbal group complexation. Verification of the statistical significance of the results: Significance testing of occurrence of high frequency herbs: The chi-square test was used to verify the frequency of occurrence of high frequency herbs. The reliability of frequency estimation was analyzed by confidence intervals to avoid small-sample errors. Robustness of cluster analysis: The sensitivity of parameters in the entropy clustering (such as the selection of threshold ) was evaluated. The stability of core combinations was observed by adjusting the parameters multiple times and repeating the clustering process. The silhouette coefficient and cluster stability index were used to evaluate the clustering quality by measuring the average intra-cluster distance and the inter-cluster distance. Quantitative evaluation of association rules: The support and confidence of herbal pairs and core combinations were calculated, and the strength of the association was determined using the lift metric. The a priori algorithm and Frequent-Pattern-Growth (FP-Growth) algorithm were used for 2-way verification of the statistical significance for high frequency combinations. Time-trend analysis: The data of the patents from different time periods (such as every 10 years) was analyzed to determine the stability of high frequency herbal combinations and exclude historical biases. The results of research studies have shown the importance of promoting blood circulation and removing stasis in the treatment of breast hyperplasia: Efficacy frequency (Table  Herbs with promoting blood circulation and removing blood stasis effects are often used to treat phlegm and fire stasis, accumulation of lumps caused by  MGH is an endocrine system disorder mainly caused by abnormal hormone secretion leading to a hormonal imbalance. MGH patients have significantly increased estradiol (E The herbs that promote blood circulation and remove blood stasis exert their breast protective effects by regulating the levels of various hormones, including E E Herbs with promoting blood circulation and removing blood stasis effects improve MGH by increasing the expression of proapoptotic proteins or decreasing the expression of antiapoptotic proteins. The B-cell lymphoma 2 (BCL2) apoptosis regulator family of proteins and cysteine aspartic protease (caspase) family of proteins play an important regulatory role in the process of apoptosis. Vascular endothelial growth factor-A (VEGFA) can promote the growth and proliferation of endothelial cells and increase the permeability of blood vessels. VEGFA and fibroblast growth factor 1 are highly expressed in patients with breast hyperplasia, and can stimulate angiogenesis through common mechanisms in vivo and in vitro, and are important indicators of angiogenesis. TCM assumes that the main cause of MGH lies in  The  It is believed in TCM that  The frequency of herbs with liver soothing effect was 526 (Table  The expression of angiogenic factors (e.g., VEGFA, FGF2) is closely related to the occurrence and development of breast hyperplasia. VEGFA can not only increase the permeability of vascular endothelial cells, but also induce the development of new mechanisms and new blood vessels by increasing vascular permeability. FGF2 is a direct inducer of angiogenesis, which can promote the regeneration of epidermal cells and endothelial cells, induce the proliferation of vascular endothelial cells and detach them from the basement membrane, which in turn induce chemotaxis of endothelial cells towards breast variant cells. Herbs with liver soothing effect inhibit the proliferation of breast cells by downregulating the expression of angiogenic factors (VEGFA and FGF2), thereby improving pituitary and ovarian function, regulating endocrine function, and improving microcirculation and local blood circulation. Herbs with liver soothing effect can not only promote the metabolism of E Soothing the liver can adjust the hypothalamicpituitaryadrenal axis, adjust the cortisol level, and thus alleviate the chronic stress state, thereby improving the abnormal mood of MGH patients, so as to achieve the purpose of healing. Herbs with  When the E The lack of P regulation and protection leads to MGH or incomplete recovery, which result in varying degrees of hyperplasia of the breast ductal epithelium and fibrous tissue, as well as cyst formation in distal glandular ducts or acini. Herbs with  The overexpression of ESR1, ESR2 and PGR can aggravate the occurrence and development of MGH, and ESR1/2 signaling can regulate the growth, development and apoptosis of mammary gland cells. The mammary gland is a target organ of E The spleen is the organ where lymphocytes reside and proliferate, as well as become activated to perform immune functions and generate specific immune responses. E MGH patients have immunosuppression, immunomodulatory dysfunction, and immune response disorders, so that the immune system cannot effectively identify, suppress and remove the diseased cells. Herbs with  Herbs with  The results revealed that the herbs with heat-clearing and detoxification properties have a large number in MGH effective patents: herbs with heat-clearing properties (985, Table  According to the medical theory of the Zhuang ethnic minority in China, there are 3 important avenues (heaven, earth, and human) and 2 pathways (blood transportation, and information sensing) in the human body. An unobstructed state is important for the 3 important avenues and 2 pathways, which results in the harmony of  Poison is a general term in the medical theory of the Zhuang ethnic minority in China. Whether the virus causes a disease after invading human body depends on the virulence strength and the human health status. If the virulence is too strong or the physical condition of the host is poor, the body energy and evil poison compete with each other, but the body energy is powerless against the evil poison, thus the 3 important avenues (heaven, earth, human) and 2 pathways (blood transportation, information sensing) are blocked by the evil poison, which results in diseases. MGH is mainly caused by the invasion of wind poison, cold poison, wet poison, heat poison and other toxic pathogens, which stagnate in the viscera and bone marrow, and obstruct the 3 important avenues and 2 pathways. The accumulation of evil poison leads to heat and swelling pain;

