VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'n the MGH herbal compound patents, which will have remarkable curative effect on clinical treatment. In this study, the patents for oral herb prescriptions for MGH treatment from the past 30 years were selected for analysis. Herbal frequency, association, and composition compatibility regularity were investigated to guide the clinical prescription and development of new drugs. This study introduces the boundary mutual distance into the mutual information registration measure. By combining mutual information and mutual distance information, the resulting new registration measure improves the mutual information registration measuring function, thus reducing the risk of the conventional maximum mutual information function falling into the extremum and defining the accurate ratio of information about the MGH patent compound composition (Figs.  Algorithm of the research process. Research process of entropy clustering of complex systems for traditional Chinese medicine compound patents.', '{-0.4782559275627136,-0.3207361400127411,0.7277417182922363,0.10978000611066818,0.26450952887535095,0.14749720692634583,0.49936988949775696,-0.5204145908355713,-0.18304792046546936,-0.7111935615539551,-0.2553786635398865,0.6489923596382141,0.10540460795164108,0.6856145858764648,-0.5847651362419128,0.27515625953674316,-0.08748210966587067,0.0637885332107544,-0.4874887764453888,-0.4652576446533203,0.14551302790641785,-0.2687970995903015,-0.12032895535230637,-0.6247859001159668,0.8346536159515381,-0.6365174651145935,0.08902812749147415,-0.3111025094985962,-0.33727195858955383,0.03874998539686203,0.05720585957169533,-0.5608301162719727,-0.2375447154045105,0.04241764545440674,0.38190001249313354,1.0848586559295654,0.4077827036380768,1.3689638376235962,0.3228471577167511,-0.03512448072433472,0.9950426816940308,-0.337902694940567,0.12600475549697876,-0.49419763684272766,0.1284629851579666,-0.6349783539772034,0.268323332071