VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 5, 'ntropy modeling and screening out herbal pairs and core combinations with strong efficacy coherence. Complex system entropy clustering and improved mutual information methods were used to construct the research program and create the research model in order to initiate the quantitative description of the correlation coefficient of Chinese medicine. The ultimate purpose was to extract the herbal pairs and herbal core combinations. Mathematical modeling was used to mine the MGH prescription patents. The most relevant core combinations of Chinese herbs were screened out by mathematical calculations, comprising core herbal pairs and herbal teams. The improved mutual information methods, complex system entropy clustering methods, and unsupervised entropy hierarchical clustering methods were used for data analysis.', '{-0.12686298787593842,-0.30626389384269714,0.5272926688194275,-0.08306935429573059,0.3095373213291168,-0.05032740533351898,-0.18862001597881317,-0.673862099647522,0.24839183688163757,-0.7948678731918335,-0.18701012432575226,0.5612491369247437,0.05819906294345856,0.8681461215019226,-0.8405290246009827,0.5881073474884033,0.18686668574810028,0.01974055916070938,-0.20277875661849976,-0.7300263047218323,-0.1943717896938324,-0.36902424693107605,0.238341823220253,-0.6435745358467102,0.8818109631538391,-0.5756654739379883,-0.6280111074447632,-0.319105327129364,-0.11161734908819199,0.7659134864807129,0.09338311105966568,-0.640856146812439,-0.3106080889701843,0.026329103857278824,-0.32113757729530334,0.8336920142173767,0.371293306350708,1.6914913654327393,0.04816915839910507,-0.13309280574321747,1.110359787940979,0.12708935141563416,-0.2219027429819107,-0.7907038331031799,-0.13036862015724182,-0.5611312389373779,0.39057600498199463,-0.24642421305179596,-0.4842889606952667,0.40378889441490173,0.9811047911643982,0.24892455339431763,-0.5370505452156067,-0.5438494086265564,0.3494150936603546,-0.497503