VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 8, 'y herbs: The chi-square test was used to verify the frequency of occurrence of high frequency herbs. The reliability of frequency estimation was analyzed by confidence intervals to avoid small-sample errors. Robustness of cluster analysis: The sensitivity of parameters in the entropy clustering (such as the selection of threshold ) was evaluated. The stability of core combinations was observed by adjusting the parameters multiple times and repeating the clustering process. The silhouette coefficient and cluster stability index were used to evaluate the clustering quality by measuring the average intra-cluster distance and the inter-cluster distance. Quantitative evaluation of association rules: The support and confidence of herbal pairs and core combinations were calculated, and the strength of the association was determined using the lift metric.', '{0.12487878650426865,0.008063915185630322,0.6041108965873718,0.6106951832771301,-0.022642644122242928,-0.04653339087963104,0.12739378213882446,-0.631299614906311,-0.3148042559623718,-0.7692268490791321,-0.30585777759552,0.24184802174568176,0.07642872631549835,0.638968825340271,0.3563919961452484,0.6478593945503235,0.10770213603973389,-0.016887767240405083,-0.006460953038185835,-1.0012792348861694,-0.6333650350570679,-0.4041493833065033,-0.17906537652015686,-0.2766077518463135,0.9027190804481506,-0.05170026794075966,-0.22667795419692993,-0.42357438802719116,-0.4423200190067291,0.6840261816978455,-0.2141999751329422,-0.6227557063102722,0.22440317273139954,-0.17328669130802155,0.0649021714925766,0.6272761821746826,-0.07115370780229568,1.36648690700531,-0.7128031849861145,-0.5340555310249329,0.19863951206207275,-0.11187876760959625,-0.03539310395717621,-1.0895946025848389,0.10994572192430496,-0.28191593289375305,0.41828545928001404,-0.09589890390634537,0.14741481840610504,0.9651212096214294,0.838905394077301,0.05556763708591461,-0.5370883345603943,-0.48